import React from "react";

function Sidebar({ handleSectionClick }) {
    return (
      <div className="sidebar">
        <ul>
        
          <li onClick={() => handleSectionClick("attendance")}>Attendance</li>
          <li onClick={() => handleSectionClick("payslip")}>Payslips</li>
          <li onClick={() => handleSectionClick("leaves")}>Leaves</li>
        </ul>
      </div>
    );
  }
  



export default Sidebar;
